    borderRadius: 10,
    fontFamily: 'GeneralSans-Medium',
    position: 'absolute',
    left: '5%',
    top: '40%',
    maxWidth: '92%',
  },
  txt5: {
    color: '#000000',
    fontSize: 14,
    fontFamily: 'GeneralSans-Semibold',
    position: 'absolute',
    left: '5%',
    top: '48%',
  },
  input5: {
    width: '92%',
    height: 42,
    borderColor: '#000000',
    borderWidth: 0.7,
    borderRadius: 10,
    fontFamily: 'GeneralSans-Medium',
    position: 'absolute',
    left: '5%',
    top: '51%',
    maxWidth: '92%',
  },
  error: {
    color: 'red',
  },
  errorsList: {
    alignSelf: 'flex-start',
    marginTop: '5%',
    marginBottom: '20%',
  },
  errorsListContent: {
    flexGrow: 1,
    justifyContent: 'flex-end',
